static inline float sigmoid(float x) {
    return 1.0f / (1.0f + expf(-x));
}
static inline float clamp(float x) {
    return fminf(fmaxf(x, 0.0f), 1.0f);
}
#define H (6)
#define W (6)
#define C (48)
#define PTS (16)
struct selected_pts_t {
    float conf;
    uint32_t h, w;
};
struct selected_pts_t selected_pts[PTS] =
{
 { -INFINITY, 0, 0 }, { -INFINITY, 0, 0 }, { -INFINITY, 0, 0 }, { -INFINITY, 0, 0 },
 { -INFINITY, 0, 0 }, { -INFINITY, 0, 0 }, { -INFINITY, 0, 0 }, { -INFINITY, 0, 0 },
 { -INFINITY, 0, 0 }, { -INFINITY, 0, 0 }, { -INFINITY, 0, 0 }, { -INFINITY, 0, 0 },
 { -INFINITY, 0, 0 }, { -INFINITY, 0, 0 }, { -INFINITY, 0, 0 }, { -INFINITY, 0, 0 },
};

void pfld_forward(int8_t* input, int* errorcode, float result[PTS][3]){

    for (int i = 0; i < PTS; i++) {
        selected_pts[i].conf = -INFINITY;
        selected_pts[i].h = 0;
        selected_pts[i].w = 0;
    }
    float* y = dnn_compute_pfld(input, errorcode);

    float (*y3d)[W][PTS][3] = (float (*)[W][PTS][3])y;
    for (uint32_t p = 0; p < PTS; p ++)
    {
        for (uint32_t h = 0; h < H; h ++)
        {
            for(uint32_t w = 0; w < W; w ++)
            {
                float conf = y3d[h][w][p][0];
                if (conf > selected_pts[p].conf)
                {
                    selected_pts[p].conf = conf;
                    selected_pts[p].h = h;
                    selected_pts[p].w = w;
                }
            }
        }
    }
    for (uint32_t p = 0; p < PTS; p ++)
    {
        uint32_t h = selected_pts[p].h;
        uint32_t w = selected_pts[p].w;

        float conf_ = selected_pts[p].conf;
        float dx_ = y3d[h][w][p][1];
        float dy_ = y3d[h][w][p][2];

        result[p][0] = sigmoid(conf_);
        result[p][1] = clamp((tanhf(dx_) * 0.5f + (float)w + 0.5f)/(float)W);
        result[p][2] = clamp((tanhf(dy_) * 0.5f + (float)h + 0.5f)/(float)H);
    }

}
